import React from 'react';

class DisplayCountries extends React.Component {

    render(){

        var countries = [{id:"ALG", name:"Algerai", capital:"St. Ann", region:"Asia", subregion:"Southeast"},
        {id:"USA", name:"United States", capital:"St. Ann", region:"Asia", subregion:"Southeast"},
        {id:"BZL", name:"Brazil", capital:"St. Ann", region:"Asia", subregion:"Southeast"}];


        return (<div>

            <h1>Search Countries</h1>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Country</th>
                        <th>Capital</th>
                        <th>Region</th>
                        <th>Sub Region</th>
                    </tr>
                </thead>
                <tbody>
                    {countries.map(country => <tr>
                            <td>country.id</td>
                            <td>country.name</td>
                            <td>country.capital</td>
                            <td>country.region</td>
                            <td>country.subregions</td>
                        </tr>
                    )}
                </tbody>

            </table>
        </div>)
    }
}

export default DisplayCountries;
